【特長】<br>●自在旋回部は、ダブルベアリングを採用し、なめらかな回転を実現しています。<br>●車輪回転部はコマーシャルベアリング入りで耐久性に優れています。<br>●スチールホイールは、デザイン性も良く特徴のある星マークの形をしています。（意匠登録済）<br>
【仕様】<br>●許容荷重(kgf):82<br>●車輪径D(mm):100<br>●車輪幅(mm):35<br>●取付高H(mm):144<br>●取付座A×B(mm):115×80<br>●取付ピッチX×Y(mm):80～90×45～50<br>●取付穴径P(mm):10.5<br>●車輪材質:スチールホイールゴム<br>
【備考】<br>●プレート式<br>●ベアリング入<br>●固定式<br>
【材質／仕上】<br>●金具:スチール<br>●金具表面処理:ユニクロムメッキ仕上げ<br>●車輪:スチールホイールゴム<br>
